import React from 'react';
import styled from 'styled-components';

const Header = () => {

    return (
        <HeaderStyled> <img src="YOUR+LOGO+HERE.png" alt="Logo" sizes="10px;"/>
            My Header </HeaderStyled>
    )
}
export default Header;


const HeaderStyled = styled.header`

color: lightblue;

`;
